		"use strict";
    
    function calc() {
      document.getElementById("result").innerHTML = getResult(); 
    }     

    function getResult() {
      let polymer = reaction(input.split(""));
      let polymer2 = input;
      let shortest = polymer2.length;
      let letters = {};      

      for (let i = 0; i < polymer2.length; ++i) {
        if (letters[polymer2[i].toLowerCase()] == undefined &&
            letters[polymer2[i].toUpperCase()] == undefined) {          
          letters[polymer2[i].toLowerCase()] = 1;
          letters[polymer2[i].toUpperCase()] = 1;

          let shortPol = [...polymer2];

          for (let j = 0; j < shortPol.length; ++j) {
            if (shortPol[j] == polymer2[i].toUpperCase() ||
                shortPol[j] == polymer2[i].toLowerCase()) {
              shortPol.splice(j, 1);
              --j;
            }
          }

          reaction(shortPol);
          shortest = (shortPol.length < shortest) ? shortPol.length : shortest;
        }        
      }

      return polymer.length + ", " + shortest;    
    }

    function reaction(polymer) {
      for (let i = 1; i < polymer.length; ++i) {
        if ((polymer[i] == polymer[i - 1].toUpperCase() && 
             polymer[i - 1] == polymer[i].toLowerCase()) ||
            (polymer[i] == polymer[i - 1].toLowerCase() && 
             polymer[i - 1] == polymer[i].toUpperCase())) {
          polymer.splice(i - 1, 2);
          i = (i > 1) ? i -= 2 : --i;
        }
      }

      return polymer;
    }
